    false,nt"url": null,nt"notes": "The biological communities at ten sites
    around the Island of Tutuila, American Samoa were surveyed in October 2002 by a
    team of four investigators. Diving observations and collections of benthic observations
    using scuba and snorkel were made at six stations in Pago Pago Harbor, two stations
    in Fagatele Bay, and one station each in Vatia Bay and Fagasa Bay. These results
    were compared with all marine organism reports for these areas by previous investigators.",nt"owner_org":
